import React from 'react'
import Navbar from '../homepage/nav';

function Contact() {
  return (
    <div className="contactfull">
    <div className='contactnav'>
        <Navbar/>
    </div>
    <div className='contactmain'>
        <h1 className='contacttext1'>ELITELOVE MATRIMONY</h1>
    </div>
    </div>
  )
}

export default Contact;
